  constructor(props) {
    super(props);
    this.state = {value: ''};
  }

  render(){
    return (
        <div className='header'>
          <div className='greeting'>
            <Greeting text="Hello Julian!" />
          </div>
          <DaySummary tasksOutsanding="3" />
        </div>

          );
  }
}

export default Header;
